    text: "# CDT start\\!\nWoke up at 6\nBreakfast sammivhes at brownies\nJens and Cheryl dropped us off  \nDrive around to chief mountain through browning\nForecast for the day was a mild start to a 3 day storm with the worst arriving the second day around 10am\nOur weather was ideal for hiking\\. \nHeard rugged grouses in the woods while cooking out lunch\\. I was twitchy about bears\\! Made sure we were both facing opposite directions\nLake Elizabeth campsites were great, a guide was also camped there with his two clients, he pointed out a mama grizzly and two babies on a distant slope\nDan and I sat on the shore with our feet in the water as the sun came out for the first time all day\n\n\n",
