    creationOSName: "iOS",
    text: "Lake Elizabeth to lake Poia\nWe woke up super early to give us enough time to get over the pass before the snow was supposed to start accumulating \nIt was a beautiful hike up with the weather really starting to increase near the pass\\. Some fresh snow on the approach\nBread bags for waterproof socks\nHigh spirits \nThe last couple miles to the lake were a slog, we got there super early, early afternoon\\. Both of us were a little meh, but after a meal and cuddling in the tent we were better\nMet nick hill and rushon and Liz\\. They went over the pass 2 hours after us and had to slog through 6 inches of snow, no visible tracks for miles\\!\nBrave little hare lived at this camp\\!\n\n",
