      '{"contents":[{"attributes":{"line":{"header":1,"identifier":"A3ADE622-486E-49CD-A01A-465EE030096D"}},"text":"Hitching the rest of the Leeds fire closure. \\n"},{"text":"Woke up and pooped next to the road. No witnesses, no bathrooms!\\nWalked a couple miles, got picked up by 2 couples in a side by side going fishing. We passed half and half and narrator and recall"},{"embeddedObjects":[{"identifier":"6315957CE80441ECB82F846FFA17A9CE","type":"photo"},{"identifier":"BC29457F2C714EC8AF97FEA1D5487FD9","type":"photo"},{"identifier":"3AC7AFF61E94434DA9F4D0122C7409CF","type":"photo"},{"identifier":"90A46A8B00A541F3BFF98514AC0A3234","type":"photo"}]},{"text":"They took us to the top where we hiked a bit with a beautiful view!\\nThen our friends who picked us up yesterday with the napping boys drove by, they didn’t have room for us though.\\nKept walking\\nThen we were picked up by our first friends on the road who were very worried about us, they took us all the way to the trail!\\nSaw TTT and flood and flamingo and met choochoo and topo. Had lunch with them\\nGot to the top of gunsight pass and waited for scooter, sky turned angry "},{"embeddedObjects":[{"identifier":"6EBF2EA102494A71A58CC9ABB6D6D98B","type":"photo"},{"identifier":"96BF3AA5E8024650A2A87A12B0C9E273","type":"photo"},{"identifier":"C3837BB8C3A747099612D62AD823E4BF","type":"photo"},{"identifier":"488F05B69BFA46B2A0C517CBB1A89455","type":"photo"}]},{"text":"We camped near the bottom, found a couple of places that weren’t total deadfall risk"}],"meta":{"created":{"platform":"com.bloombuilt.dayone-ios","version":2524},"small-lines-removed":true,"version":1}}',
    creationDate: "2024-08-15T22:04:41Z",
    text: "# Hitching the rest of the Leeds fire closure\\. \nWoke up and pooped next to the road\\. No witnesses, no bathrooms\\!\nWalked a couple miles, got picked up by 2 couples in a side by side going fishing\\. We passed half and half and narrator and recall\n\nThey took us to the top where we hiked a bit with a beautiful view\\!\nThen our friends who picked us up yesterday with the napping boys drove by, they didn’t have room for us though\\.\nKept walking\nThen we were picked up by our first friends on the road who were very worried about us, they took us all the way to the trail\\!\nSaw TTT and flood and flamingo and met choochoo and topo\\. Had lunch with them\nGot to the top of gunsight pass and waited for scooter, sky turned angry\n\nWe camped near the bottom, found a couple of places that weren’t total deadfall risk",
