    creationDate: "2024-08-18T19:41:01Z",
    text: "# Titcomb basin to town\\.\nWoke up early and say the pink sunrise on the peak tops around me\n\nSuch a good nights sleep, so silent\n\nNo one showed up to claim the tent\n\nWalking out of basin was most beautiful morning, didn’t see anyone else for a long time\n\nHiking fast with the thought of town food on my mind, stopped for lunch and a little wash at lake Barbara \n\nLeapfrogged with Sarah who lives in the area a few times, and she offered me a ride if no one got to me first  \n\nSaw Recall, Narrator, Half and Half, and link on their way back to trail as I was on the long hike out\\.\n\nHit the parking lot, kept walking along the road\\. Sarah scooped me up and dropped me at the brewery\\.\n\nThen to the jackalope motor lodge for a shower and early bed",
