      '{"contents":[{"attributes":{"line":{"header":1,"identifier":"616A3D8A-FB11-4E35-917A-A2C8964A5231"}},"text":"Bruised face\\n"},{"attributes":{"line":{"header":0,"identifier":"34507E85-E1C9-4890-A3D9-2EB6938F4114"}},"text":"Osprey hunting\\n"},{"attributes":{"line":{"header":0,"identifier":"7B460FE8-CF82-491F-A717-A2B09F53C982"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"25EBC652-40E8-471A-A51E-DF4013CE702A"}},"text":"First View of the valley, awestruck. 1000% improvement of mood immediately "},{"embeddedObjects":[{"identifier":"A3680F7792B945EBB49EFEAAC8D314E9","type":"photo"}]},{"attributes":{"line":{"header":0,"identifier":"285A0DB0-9E96-46A4-B29F-BD58B1679DE2"}},"text":"Saw osprey hunt and catch! And fly away with fish!\\n"},{"attributes":{"line":{"header":0,"identifier":"699E1BF9-09C2-4B79-9E46-2EC510B619F5"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"1CD64BFF-CFC6-49F4-9C18-D334EEE7C4E9"}},"text":"Soaked feet in shadow lake, snacked, found wolf’s head and the towers"},{"embeddedObjects":[{"identifier":"9386231BFBBB4442B801D4A5065BF6A2","type":"photo"},{"identifier":"3D19954F7FF9417AB567E33382F47617","type":"photo"},{"identifier":"9D1568EA5F6A4786815F0CB9DDCDE329","type":"photo"}]},{"text":"Gave a dehydrated guy water, snacked with goshawk and semper, kept hiking up past more stunning lakes\\n\\nPee break with goshawk, neilbob catches up\\n\\nSnacked with goshawk and hundo catches up while we watch neilbob and hot pocket ascend Texas pass\\n\\nWe do it in 25 minutes, passing 4 guys\\n\\nLaughing at the top with neilbob and hindo and goshawk \\n\\nToo windy, descend to pretty green shelf after some snow section. Cook noodles with hundo and goshawk\\n\\nSteep descent to lake and up javkass pass\\n\\nDown to another lake and up towards rapid lake to camp\\n\\nDinner party with goshawk and hundo \\n\\nBest day on trail so far "}],"meta":{"created":{"platform":"com.bloombuilt.dayone-ios","version":2529},"small-lines-removed":true,"version":1}}',
    creationDate: "2024-08-22T17:24:10Z",
    text: "Bruised face\nOsprey hunting\n\nFirst View of the valley, awestruck\\. 1000% improvement of mood immediately\n\nSaw osprey hunt and catch\\! And fly away with fish\\!\n\nSoaked feet in shadow lake, snacked, found wolf’s head and the towers\n\nGave a dehydrated guy water, snacked with goshawk and semper, kept hiking up past more stunning lakes\n\nPee break with goshawk, neilbob catches up\n\nSnacked with goshawk and hundo catches up while we watch neilbob and hot pocket ascend Texas pass\n\nWe do it in 25 minutes, passing 4 guys\n\nLaughing at the top with neilbob and hindo and goshawk \n\nToo windy, descend to pretty green shelf after some snow section\\. Cook noodles with hundo and goshawk\n\nSteep descent to lake and up javkass pass\n\nDown to another lake and up towards rapid lake to camp\n\nDinner party with goshawk and hundo \n\nBest day on trail so far",
