      '{"contents":[{"attributes":{"line":{"header":1,"identifier":"AC31C597-C40A-490B-9FD2-1EF18B5CF182"}},"text":"Into the basin!\\n"},{"attributes":{"line":{"header":0,"identifier":"D4302E2E-886B-476C-98C4-3B2173023AC5"}},"text":"Laundry, breakfast, sort resupply,\\n"},{"attributes":{"line":{"header":0,"identifier":"29D997DB-EF31-41B0-9562-C92EB6DADED5"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"195C3B47-06C0-4B43-BE30-D3C66281F110"}},"text":"Desert springs store, church, lunch at mercantile, got a little history, saw front loader but didn’t know it was him!\\n"},{"attributes":{"line":{"header":0,"identifier":"66D6D854-09B3-4FDF-BBB2-E4F07CA2D963"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"21408DD0-2A0A-401B-A4D5-53C0F5EA3209"}},"text":"Tried to get a meal to go at the grub stake\\n"},{"attributes":{"line":{"header":0,"identifier":"97AF2580-8615-4D74-9E95-3E3E3B1B9EEC"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"1F55B23A-5622-4008-8B8A-58B3ABA8F87E"}},"text":"Called Dan, called mom, left town around 2\\n"},{"attributes":{"line":{"header":0,"identifier":"60623559-D5F9-402F-AE6E-57D8AB1A1B76"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"1F157A0D-DB18-4227-943B-C9AA974A4DCE"}},"text":"Periods of stinging rain. NYC biker boys caught up to me. They walked with me for a bit and then pedaled ahead and waited and walked with me again. Until I had to shoo them away so I could pee.\\n"},{"attributes":{"line":{"header":0,"identifier":"6A6B5D83-5FEF-4E5C-9F00-C886CE9E1300"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"7B8C7D15-3768-411B-88D5-2023C4DA3184"}},"text":"Sideways rain gave way to gentle drops and then even those dissipated. The sun fought to come out and the air calmed. 60 deg perfect hiking temp\\n"},{"attributes":{"line":{"header":0,"identifier":"C748EE62-F373-4533-8EE5-2BE99E0D94D1"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"A337F155-CE43-483D-A7A8-820484DA5BC2"}},"text":"Got to intended site way early decided to keep hiking. Stopped for dinner in sun before water source. \\n"},{"attributes":{"line":{"header":0,"identifier":"DBA210B6-291B-4B4C-BD96-5E43D3322429"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"FF9E2394-C12B-4FAF-B830-65CAAAE34FD4"}},"text":"COWS! Started hiking with me! Gang at the cow gate. Let me pass.\\n"},{"attributes":{"line":{"header":0,"identifier":"67468F2B-F427-488F-B7BF-C3A5250ED373"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"31D10191-2FBC-424F-9131-C891D092D92C"}},"text":"Another mile to camp. Heard cows and coyotes and lightning strikes all night "}],"meta":{"created":{"platform":"com.bloombuilt.dayone-ios","version":2529},"small-lines-removed":true,"version":1}}',
