      '{"contents":[{"attributes":{"line":{"header":1,"identifier":"1F36A4B2-E424-413C-A6F6-9723069C4659"}},"text":"Cold cold cold morning \\n"},{"attributes":{"line":{"header":0,"identifier":"9AAA9B23-67E3-4C60-991F-25F1E4A4B290"}},"text":"Stopped for breakfast in the sun, got too ea and then cold again\\n"},{"attributes":{"line":{"header":0,"identifier":"C59BEF4B-64E3-4B07-BAE0-6B4CD005CE61"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"63DC7058-03C8-456A-BCEF-A05E14DC4600"}},"text":"Stopped for water at a spring, met a section hiker nobo (sunny side up)\\n"},{"attributes":{"line":{"header":0,"identifier":"3DB8D2B5-A0E5-47DF-A101-965FF3D861C1"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"70C7F957-7881-4465-A8B6-3D1E32ED43DA"}},"text":"Sumitted thinking of Dan 3 times just off trail\\n"},{"attributes":{"line":{"header":0,"identifier":"9DCC5413-DD98-4DF2-AA4E-A7F7F02BBDC3"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"BABF516C-599C-4020-915B-7EB273B9B7B5"}},"text":"Stopped for water at a second stop for lunch, didn’t get enough water\\n"},{"attributes":{"line":{"header":0,"identifier":"0F8277A4-3DC5-40D9-8ACC-7B1355D34ED9"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"C988D8DF-2460-4B56-9E89-BA31A8F6787C"}},"text":"Met a hunter near sunset, talked about elk and bears \\n"},{"attributes":{"line":{"header":0,"identifier":"5241009D-F2C3-47E5-8BED-4179EA39E6DA"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"0E1B5E4C-920C-489E-A4DF-9234736B6457"}},"text":"Got some water from some hunters near my campsite. \\n"},{"attributes":{"line":{"header":0,"identifier":"880605D6-DBAD-4134-BD53-DFBD0C0ABD52"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"000E3060-FF95-456C-9E76-D8862BCE874B"}},"text":"Ate dinner while the moon set"}],"meta":{"created":{"platform":"com.bloombuilt.dayone-ios","version":2532},"small-lines-removed":true,"version":1}}',
