    richText:
      '{"contents":[{"attributes":{"line":{"header":1,"identifier":"71C8D92E-3A63-47B7-8481-BF74C7AF9A7D"}},"text":"Tons of northern flickers\\n"},{"attributes":{"line":{"header":0,"identifier":"0104148A-1D42-4C14-98EC-17B568771543"}},"text":"Hunters on the ridge\\n"},{"attributes":{"line":{"header":0,"identifier":"4E8534DE-92A9-4B06-AB5D-2217BE0F6F07"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"8A68C7CE-EA3E-41FA-A153-1563B951FA95"}},"text":"Cold breakfast near stream, very cold. Northern flicker feather on the ground.\\n"},{"attributes":{"line":{"header":0,"identifier":"5D764517-CDCA-4CBF-BD5B-2C551DDC708D"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"1CFCFB76-0ECA-40A3-977B-93124CF71B0F"}},"text":"Lots of climbing up towards a pretty ridge. Had a lunch there,\\n"},{"attributes":{"line":{"header":0,"identifier":"D73D4F8C-BD2A-4E73-B857-6BF5B94BD0F0"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"97660EDD-8B7B-4AE3-BD94-85575612C7E3"}},"text":"The rest of the climb up to park view summit was a killer. Had to stop every few moments.\\n"},{"attributes":{"line":{"header":0,"identifier":"28882A83-A34A-4841-9FF2-92AB6B5F98B1"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"AD7EE56A-C5C4-408E-B5A6-004F7AC8658A"}},"text":"Lots of bilberries on the descent\\n"},{"attributes":{"line":{"header":0,"identifier":"BFF723AD-B5B3-46B6-8662-F41796CACC43"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"74F99047-C0CE-4B52-8F0B-B612BC926748"}},"text":"Kent and Gary at the top, and two little dogs. chatted for a bit, then saw them again at the trailhead in an amazing cabover camper.\\n"},{"attributes":{"line":{"header":0,"identifier":"04E5DE6F-C465-4AF5-B494-B2BCC7F38F4C"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"D7810CA7-DCD4-4B3C-B63E-078CB44BAF8F"}},"text":"One beer with them and one to go.\\n"},{"attributes":{"line":{"header":0,"identifier":"AA577589-A274-4CCC-9754-DA71DA5EFDB7"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"DFDE85A4-0648-4F05-93A0-49F66FC7A908"}},"text":"Nice shoulder of the trail for an early bed. In bed by 8\\n"},{"attributes":{"line":{"header":0,"identifier":"3CEE6841-502E-4902-853D-485DD289F0BE"}},"text":"\\n"},{"attributes":{"line":{"header":0,"identifier":"1BE04D5F-3FDC-4A0C-86E4-09745D6F74D7"}},"text":"So hard to catch my breath all day, even hard to eat dinner with how hard I need to breathe. Even lying in bed is only a little restful at first camping at 9730 ft, last night was 10630"}],"meta":{"created":{"platform":"com.bloombuilt.dayone-ios","version":2532},"small-lines-removed":true,"version":1}}',
